import React from 'react';
const Login =() =>{
 return(
    <div class =" inline-grid  mt-20">
        <h1 class='text-center font-bold text-lg '>Login  </h1>
        <label class="text-left font-bold text-sky-300 mt-8">*Email*</label>
        <input type='email' class=" form-input w-56 outline outline-offset-2 outline-1  rounded-md mt-2" placeholder='Enter your email' />
        <label class="text-left font-bold text-sky-300 mt-5">*Password*</label>
        <input type='password' class=" w-56 outline outline-offset-2 outline-1  rounded-md mt-2" placeholder='Enter your password' />
        <button class=' w-10 outline outline-offset-2 outline-2 text-left mt-5' >Login</button>

    </div>
 )
}

export default Login;
